INSERT INTO `case` (`Case_Id`, `Title`, `Summary`, `Date_Of_FIR`, `Admin_Id`) VALUES
(1001, 'Kolkata Air Hostess death', 'Anwesha Mukherjee,who was employed as an air hostess with Indian Airlines,killed herself on February 18(2019) evening by jumping off the terrace of her apartment near Dumdum airport gate Number 1. A case of unnatural death was registered at the Bidhannagar police Station.', '2019-02-18', 'dutta.nitish50@gmail.com'),
(1002, 'Abhijeet Kidnap & Murder', 'A 19-year-old, Abhijeet Dutta, son of a renowned businessman, in Kolkata was murdered. His body was found near Nalban lake in the saltlake sector-5 area, with his hands tied together. As reported by a senior official, Abhijeet was kidnapped on March 15 and his body was found on 19th March morning.', '2019-03-16', 'joyacharya87@gmail.com'),
(1003, 'Prophecied murder of a sister', 'Body of a woman, recognized by locals as Sister Ahalya, was found dead in the well of St Peter\'s Convent in the city of Goa, on 8 November, 2008. She was reported missing in the morning of 5 November, 2008. Her death was reported to the local police which initially closed it with a theory of suicide on 13 February, 2009. It was reopened on 4 April,2009 by the Central Bureau of Investigation.', '2009-04-04', 'rupaliS15@yahoo.com');

