INSERT INTO `case_log` (`Entry_No`, `Case_Id`, `Officer_Id`, `Date`, `Progress_Info`, `Case_Status`) VALUES
(1, 1001, 'abdulR1981@yahoo.com', '2019-02-18', 'Two glasses of wine is found on the table at the crime scene', 'Pending'),
(1, 1002, 'jasbirSh77@gmail.com', '2019-03-19', 'A wrist watch was found at the crime spot which is sent to the Forensic Lab for testing.', 'Pending'),
(1, 1003, 'basuM1980@yahoo.com', '2009-04-04', 'Sister Ahalya was reported missing on the morning on 05 November,2008. Three days later, her body was found in the hostel\'s well in the early hours of the day.', 'Pending'),
(2, 1001, 'abdulR1981@yahoo.com', '2019-02-18', 'A rope on the floor of the balcony was found and collected', NULL),
(2, 1002, 'jasbirSh77@gmail.com', '2019-03-19', 'A Smart Phone was found at the crime spot.', 'Pending'),
(2, 1003, 'basuM1980@yahoo.com', '2009-04-04', 'At 10:00 am on 08 November, 2008, the deceased was removed from the well by the fire force and an inquest was drawn up by the local police. Photographs of the body were also taken. Clothing of Abhaya was taken into custody.', 'Pending'),
(3, 1001, 'abdulR1981@yahoo.com', '2019-02-19', 'A purse is found on the sofa at the crime scene, it does not belong to the victim.', 'Pending'),
(3, 1002, 'sanjeevG04@gmail.com', '2019-03-20', 'It is found that the wrist watch belongs to Ashis Jadav (Friend of the victim). ', NULL),
(3, 1003, 'basuM1980@yahoo.com', '2009-04-04', 'Post-mortem conducted on the body found abrasions on the right shoulder and hip and two small lacerations above the right ear. There was no sign of sexual assault. It indicated death by drowning but also reported on the possibility of homicide based on head injuries. The results were declared on 27 December, 2008.', 'Pending'),
(4, 1001, 'sanjeevG04@gmail.com', '2019-02-19', 'Some empty strips of a strong sleeping drug is found under the cushion of the sofa at the crime scene', NULL),
(4, 1002, 'sanjeevG04@gmail.com', '2019-03-20', 'The smart phone found at the crime spot belongs to an uber driver named Pritam Bera.', 'Pending'),
(4, 1003, 'basuM1980@yahoo.com', '2009-04-04', 'Despite the potentially significant injuries, the death was ruled a drowning on 13 February, 2009 after a series of inquiries, plagued by internal conflict, bitter rivalries and allegations of corruption and bias, compounded by pressure from many quarters to bring the case to conclusion.', 'Pending'),
(5, 1001, 'sanjeevG04@gmail.com', '2019-02-20', 'All the evidences found at the crime spot are sent to the Forensic lab for further testing.', 'Pending'),
(5, 1002, 'basuM1980@yahoo.com', '2019-03-20', 'Post-mortem shows that Abhijeet was killed by stabbing with a knife or similar kind of thing', 'Pending'),
(5, 1003, 'basuM1980@yahoo.com', '2009-04-04', 'The case is reopened on 4 April,2009 by the Central Bureau of Investigation under the direct supervision of its officer Andrew Thomas.', 'Pending'),
(6, 1001, 'abdulR1981@yahoo.com', '2019-02-21', 'On one of the wine glasses, A fingerprint is collected which matches to the finger prints of Supriya Roy Chowdhury- Sister-In-Law of the victim. Supriya is recorded as one of the suspects in the case.', 'Pending'),
(6, 1002, 'jasbirSh77@gmail.com', '2019-03-20', 'Some burnt pieces of Abhijeet\'s bag was found into the dustbin of Vishal\'s (Abhijeet\'s friend) bathroom.', 'Pending'),
(6, 1003, 'sharmaN1975@yahoo.com', '2019-07-17', 'The CBI questions the family, friends and members of the convent individually about the death. Family members and close friends opined that it was a case of homicide and not suicide. Members of the convent denied all allegations.', 'Pending'),
(7, 1001, 'sanjeevG04@gmail.com', '2019-02-22', 'Got the call records of Anwesha', 'Pending'),
(7, 1002, 'sanjeevG04@gmail.com', '2019-03-21', 'CCTV footage of a Cafe near saltlake sector-5 is collected which shows Abhijeet aqnd his uncle(Manoj Dutta) had a heated conversation on the evening of Abhijeet\'s kidnapping. ', NULL),
(7, 1003, 'sharmaN1975@yahoo.com', '2009-07-17', 'A sister named Stephy that Sister Ahalya was behaving differently in the last week before her death. According to her, Ahalya was a “bubbly, talkative person and a bright student” but she became “quieter and lost”. Her friends had a different opinion. Close friends claimed she had dinner with them last night and showed no signs of abnormal behaviour.', 'Pending'),
(8, 1001, 'sanjeevG04@gmail.com', '2019-02-22', 'According to the call records of Anwesha, She has called her husband Suman twice on that day. Her ex-Colleague Richa has called her four times on that day.', NULL),
(8, 1002, 'basuM1980@yahoo.com', '2019-03-21', 'CCTV footage of Nalban Lake gate-1 is collected. It shows that an uber cab (No: WB085677) was parked there on 19th March around 2 a.m. for almost 2 hours.', 'Pending'),
(8, 1003, 'basuM1980@yahoo.com', '2009-10-23', 'On 22 October,2009 officer Andrew Thomas resigned from the service of CBI and from the investigation of Sister Ahalya’s death. He had seven more years in service to retire. He had arrived at the conclusion that Ahalya’s death was a case of murder and he had recorded it as such in the case diary. He also announced in the media that he had resigned from CBI as his conscience did not permit him to comply with a strong directive given by his superior officer Maathuvarasan Nair, who had asked him to record the death as suicide in the case diary.', 'Pending'),
(9, 1001, 'abdulR1981@yahoo.com', '2019-02-23', 'The purse found at the crime spot belongs to Richa Rai (ex-colleague of Anwesha). ', NULL),
(9, 1002, 'sanjeevG04@gmail.com', '2019-03-21', 'Call Records of Abhijeet Shows that the Last 2 calls he made before his kidnapping were to: Vishal Mitra(friend)\r\n         Ashis Jadav(friend)\r\nand last call that he received was of P.K.Mittal.', 'Pending'),
(9, 1003, 'sharmaN1975@yahoo.com', '2010-01-03', 'On 03 January,2010, forensic medical expert’s Dr S K Patra, Dr Ashok Verma and Dr S R Ranjan conducted Dummy experiments leading them to conclude that homicide could not be ruled out.', 'Pending'),
(10, 1001, 'abdulR1981@yahoo.com', '2019-02-24', 'By investigating the neighbors of Anwesha, it is reported that there was some very serious issues regarding the Rajharhat Property, between Anwesha and her Sister-In-Law Supriya. ', 'Pending'),
(10, 1002, 'basuM1980@yahoo.com', '2019-03-22', 'All details of the Uber Driver Pritam Bera is collected from the regional office of UBER. ', 'Pending'),
(10, 1003, 'basuM1980@yahoo.com', '2010-03-21', 'On 20 March,2010, V. K. Namboothiri, the Assistant Sub Inspector who prepared the First Information Report during the initial case investigation, was found dead. Police said he committed suicide by cutting his wrist. A suicide note cited mental torture by Archbishop Thomas McArthur of the convent along with some other powerful members of the convent. He also received death threats from an influential Christian political leader Robert Samson. In the case diary, he had recorded that Ahalya might have seen something objectionable in the dining room and could have been silenced.', 'Pending'),
(11, 1001, 'sanjeevG04@gmail.com', '2019-02-24', 'Anwesha\'s family accused Suman Roy Chowdhury and his parents of being responsible for the air hostess\'s death. Anwesha\'s mother said that Suman used to repeatedly assault her daughter and that the domestic violence began during the couple\'s honeymoon after their marriage in February 2016.', 'Pending'),
(11, 1002, 'basuM1980@yahoo.com', '2019-03-22', 'As informed by the family of the uber driver Pritam that, he is not in contact with them from March-15 night, even he did not return home since that day', 'Pending'),
(11, 1003, 'sharmaN1975@yahoo.com', '2010-08-30', 'On 29 August,2010 Narco-Analysis tests were performed on Fr. Peter Joseph, Fr. John Wesley, Sr. Stephy and some other members of the convent who were believed to have knowledge about the case. The tapes of the recorded Narco-Analysis tests revealed the confessions of Fr. Peter Joseph, Fr. Martin Fransis, Sr. Stephy who were all in the state of sedation. The videos showed the suspects detailing what happened during the night of the murder after having injected with the truth serum.', 'Pending'),
(12, 1001, 'sanjeevG04@gmail.com', '2019-02-24', 'Anwesha\'s family also revealed that around a fortnight before her death, her father had written to the Bidhanagar Police saying, \"...if any physical harm is caused to my daughter, Suman Roy Chowdhury as well as the in-laws will be held responsible.\" The police did not react to the letter then. ', NULL),
(12, 1002, 'jasbirSh77@gmail.com', '2019-03-24', 'Police got some documents that shows Vishal and Ashis have borrowed a huge amount of money from banks as well as from private financiers 8 months ago', 'Pending'),
(12, 1003, 'sharmaN1975@yahoo.com', '2010-08-30', 'The Narco-analysis investigations and their brain-mappings revealed that Ahalya woke up on 05 November,2008 early in the morning, descended the staircase and went to the hostel kitchen to get a drink of water from the refrigerator. Sr. Stephy hit Ahalya with an axe thrice on the back of the head. She then collapsed. Thinking that Ahalya was dead, Joseph and Fransis, assisted by Stephy, lifted Ahalya’s body, took it out of the kitchen and dumped it in the well of the convent.', 'Pending'),
(13, 1001, 'sanjeevG04@gmail.com', '2019-02-24', 'Anwesha\'s parents also claimed that their daughter had been tortured both physically and mentally by her in-laws in demand of dowry  ', 'Pending'),
(13, 1002, 'sanjeevG04@gmail.com', '2019-03-24', 'Vishal Mitra (Abhijeet\'s friend) got missing from 23rd March morning.', 'Pending'),
(13, 1003, 'sharmaN1975@yahoo.com', '2010-09-02', 'Allegations have been made that the tape recordings of the Narco-Analysis tests were manipulated. CDIT submits the findings that the CD’s have been doctored more than 30 times. Court orders CBI to submit original CD’s within 10 days.', 'Pending'),
(14, 1001, 'abdulR1981@yahoo.com', '2019-02-25', 'As reported by the neighbors of Anwesha, the last two person, who came to Anwesha\'s apartment, just before her death were: her husband Suman and her Sister-in-Law Supriya', NULL),
(14, 1002, 'basuM1980@yahoo.com', '2019-03-24', 'By tracking the Mobile location of Ashis Jadav (Abhijeet\'s friend), he got arrested.', 'Pending'),
(15, 1001, 'abdulR1981@yahoo.com', '2019-02-26', 'Postmortem report shows the presence of a very strong sleeping drug in Anwesha\'s Blood sample. Also the report reveals She was Drugged through Some alcohol. ', 'Pending'),
(15, 1002, 'jasbirSh77@gmail.com', '2019-03-25', 'By interrogating Ashis Jadav finally he confessed that How they (Ashis,Vishal, Pritam) hatched a plan to kidnap Abhijeet. The accused thought Abhijeet’s father Mr. Anurag Dutta would easily cough up the money without informing the police. But when Abhijeet’s father approached police to file a case, they felt their plan was going off the track. They then decided to kill Abhijeet, fearing he would reveal their names if he’s let off. Ashis Also shared information about the current location of his other two associates. ', 'Pending'),
(16, 1001, 'abdulR1981@yahoo.com', '2019-02-26', 'Postmortem report shows that there is some marks present on Anwesha\'s hand and foots. The marks are possibly caused due to tieing tightly by some rope or similar kind of thing.', 'Pending'),
(16, 1002, 'basuM1980@yahoo.com', '2019-03-25', 'Finally Vishal Mitra and uber driver Pritam Bera were arrested', 'Closed'),
(17, 1001, 'sanjeevG04@gmail.com', '2019-02-27', ' Anwesha\'s family sensationally released a set of photos they said were proof that the air hostess was a victim of domestic assault.', 'Pending'),
(19, 1001, 'sanjeevG04@gmail.com', '2019-02-28', 'Phone records collected by the police show that Anwesha messaged a friend at 8:56 pm that day. That WhatsApp message read: \"He [Suman] has locked me inside room. Please call police. Please come if you can. I am locked up...\"\r\n\r\n\"Finally I got my phone, I am at N 116... I need help.. he [Suman] is sitting outside guarding my room...,\" Anwesha said in another WhatsApp message sent a minute later. The friend told her that she could not come right away but said that another friend could reach Anwesha\'s home sooner.', 'Pending'),
(20, 1001, 'sanjeevG04@gmail.com', '2019-02-28', 'As reported, Anwesha got into an argument with Suman on February 18 evening around 8:30 p.m. The couple\'s neighbour heard a \"heated argument\" take place.', 'Pending'),
(21, 1001, 'abdulR1981@yahoo.com', '2019-03-01', 'Anwesha\'s husband, Suman Roy Chowdhury, employed with a software firm in Newtown kolkata, was arrested on charges of domestic assault and causing dowry death.', 'Closed');

